import React, { useState, useEffect } from 'react';
import axios from 'axios';

const SuperAdminDashboard = () => {
  const [dashboardData, setDashboardData] = useState({
    totalRequests: 0,
    completedRequests: 0,
    pendingRequests: 0,
    delayedRequests: 0,
    totalResidents: 0,
    delayedRequestsList: []
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Fetch dashboard summary data
    axios.get('/api/admin/dashboard')
      .then(response => {
        setDashboardData(prev => ({
          ...prev,
          totalRequests: response.data.totalRequests,
          completedRequests: response.data.completedRequests,
          pendingRequests: response.data.pendingRequests,
          totalResidents: response.data.totalResidents
        }));
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching dashboard data:', error);
        setLoading(false);
      });

    // Fetch delayed requests
    axios.get('/api/admin/delayed-requests')
      .then(response => {
        setDashboardData(prev => ({
          ...prev,
          delayedRequests: response.data.length,
          delayedRequestsList: response.data
        }));
      })
      .catch(error => {
        console.error('Error fetching delayed requests:', error);
      });
  }, []);

  if (loading) {
    return <div>Loading dashboard...</div>;
  }

  return (
    <div className="super-admin-dashboard">
      <h1>Super Admin Dashboard</h1>
      
      <div className="stats-container">
        <div className="stat-card">
          <h3>Total Requests</h3>
          <p>{dashboardData.totalRequests}</p>
        </div>
        
        <div className="stat-card">
          <h3>Completed Requests</h3>
          <p>{dashboardData.completedRequests}</p>
        </div>
        
        <div className="stat-card">
          <h3>Pending Requests</h3>
          <p>{dashboardData.pendingRequests}</p>
        </div>
        
        <div className="stat-card">
          <h3>Delayed Requests</h3>
          <p>{dashboardData.delayedRequests}</p>
        </div>
        
        <div className="stat-card">
          <h3>Total Residents</h3>
          <p>{dashboardData.totalResidents}</p>
        </div>
      </div>

      <div className="delayed-requests-section">
        <h2>Delayed Requests</h2>
        <table>
          <thead>
            <tr>
              <th>Request ID</th>
              <th>Title</th>
              <th>Days Delayed</th>
              <th>Assigned To</th>
            </tr>
          </thead>
          <tbody>
            {dashboardData.delayedRequestsList.map(request => (
              <tr key={request.id}>
                <td>{request.id}</td>
                <td>{request.title}</td>
                <td>{request.daysDelayed}</td>
                <td>{request.assignedTo}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default SuperAdminDashboard;
